import React from 'react';

export const Filter = ({ filter, handleFilterChange }) => {
  return (
    <>
      <p>Find contacts by name</p>
      <input
        type="text"
        value={filter}
        name="filter"
        onChange={handleFilterChange}
        placeholder="Find contacts by name"
      />
    </>
  );
};
